    { time: '22:00', value: 9 },
    { time: '00:00', value: 1 },
    { time: '02:00', value: 3 },
    { time: '04:00', value: 2 },
    { time: '06:00', value: 7 },
    { time: '08:00', value: 5 },
  ]
}
const data= Object.entries(list)
  const config = {
    data,
    height: 400,
    xField: 'time',
    yField: 'value',
    point: {
      size: 5,
      shape: 'circle',
    },
    label: {
      style: {
        fill: '#aaa',
      },
    },
  };
  return <Line {...config} />;
};
export default Page;
